import data from './processed_news.json';
import HomePage from './HomePage.js'
import Article from './Article.js';
import './App.css';

function App() {
  return (
    <div className='top'> 
         <HomePage /> 
         <> <div className='next'>
         {data.map((article, index) => (
        <Article key={index} article={article} />
      ))}
        </div>
         </>
  </div>
  );
}

export default App;
